package com.song.db;import java.util.List;/** * description: * author:          song * createDate:      2017/10/9 */public class PagedData {    private int pageIndex;    private int pageSize;    private List data;    public int getPageIndex() {        return pageIndex;    }    public void setPageIndex(int pageIndex) {        this.pageIndex = pageIndex;    }    public int getPageSize() {        return pageSize;    }    public void setPageSize(int pageSize) {        this.pageSize = pageSize;    }    public List getData() {        return data;    }    public void setData(List data) {        this.data = data;    }}